import React,{Component} from 'react';
import {ContextConsumer} from '../context/Context';

class Cart extends Component{

    render(){
        return(
            // <h1>Cart</h1>
            <ContextConsumer>
                {(data)=>{
                    let temp=data.devices.filter((item)=>{

                        return item.added===true;
                            temp.map(item=>{
                                <table class="table table-striped table-dark">
                                <thead>
                                    <tr>
                                    <th scope="col">#</th>
                                    <th scope="col">First</th>
                                    <th scope="col">Last</th>
                                    <th scope="col">Handle</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    <tr>
                                    <th scope="row">1</th>
                                    <td>Mark</td>
                                    <td>Otto</td>
                                    <td>@mdo</td>
                                    </tr>
                                    <tr>
                                    <th scope="row">2</th>
                                    <td>Jacob</td>
                                    <td>Thornton</td>
                                    <td>@fat</td>
                                    </tr>
                                    <tr>
                                    <th scope="row">3</th>
                                    <td>Larry</td>
                                    <td>the Bird</td>
                                    <td>@twitter</td>
                                    </tr>
                                </tbody>
                                </table>
                            })
                         })
                    console.log(temp)

                }}
            </ContextConsumer>
        )
    }
}

export default Cart;
